import { isToday, format, parseISO, isAfter } from "date-fns";
import ptBR from "date-fns/locale/pt-BR";

import { useAuth } from "../../hooks/auth";

import {
  Container,
  Header,
  HeaderContent,
  Profile,
  Content,
  ImagesProfile,
  NextBaseUrlImage,
} from "./styles";

import { FiClock } from "react-icons/fi";

const Dashboard: React.FC = () => {
  return (
    <Container>
      <Header>
        <HeaderContent>
          <Profile>
            <div>
